export default function RestrictedPage({ isLoggedIn, user, Login, Logout }) {
  return isLoggedIn ? (
    <div>
      <h1> Bem vindo o{user}</h1>
      <button onClick={Logout}>Sair</button>
    </div>
  ) : (
    <div>
      <h1> Precisa logar </h1>
      <button onClick={() => Login()}>Entrar</button>
    </div>
  );
}
